import React, { useEffect, useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  useMediaQuery,
  useTheme,
} from "@mui/material";
import { Link } from "react-router-dom";
import { useAuth } from "../../components/context/AuthContextProvider";
import { ADMIN_EMAIL } from "../../helpers/const";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Close";
import "./Navbar.css";

const Navbar = () => {
  const { user, handleLogOut, loading } = useAuth();
  const [isAdmin, setIsAdmin] = useState(false);
  const [drawerOpen, setDrawerOpen] = useState(false);

  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down("sm"));

  useEffect(() => {
    setIsAdmin(user?.email === ADMIN_EMAIL);
  }, [user]);

  const pages = [
    { id: 1, title: "Атлеты", link: "/athletes" },
    { id: 2, title: "Виды спорта", link: "/sports" },
    { id: 3, title: "Медальный зачет", link: "/medal-table" },
  ];

  if (isAdmin) {
    pages.push({ id: 4, title: "Админ", link: "/admin" });
  }

  return (
    <div className="navbar-root">
      <AppBar position="static" className="navbar-appbar">
        <Toolbar className="navbar-toolbar">
          <div className="navbar-left">
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Flag_of_Kyrgyzstan_%283-2%29.svg/1599px-Flag_of_Kyrgyzstan_%283-2%29.svg.png?20240311163127"
              className="navbar-flag"
              alt="Flag"
            />
            <Link to="/" className="navbar-title">
              Спортсмены КР
            </Link>
          </div>

          {!isMobile && (
            <div className="navbar-center">
              {pages.map((page) => (
                <IconButton
                  key={page.id}
                  color="inherit"
                  component={Link}
                  to={page.link}
                  className="navbar-menu-button"
                >
                  <Typography className="navbar-menu-item">
                    {page.title}
                  </Typography>
                </IconButton>
              ))}
            </div>
          )}

          <div className="navbar-right">
            <Typography className="navbar-user-text">
              {user
                ? `Добро пожаловать, ${user.displayName || user.email}`
                : "Добро пожаловать, гость"}
            </Typography>
            <IconButton
              edge="end"
              color="inherit"
              aria-label="menu"
              onClick={() => setDrawerOpen(true)}
              className="navbar-menu-button"
            >
              <MenuIcon />
            </IconButton>
          </div>
        </Toolbar>
      </AppBar>

      <Drawer
        anchor="right"
        open={drawerOpen}
        onClose={() => setDrawerOpen(false)}
        className="navbar-drawer"
      >
        <div className="navbar-drawer-header">
          <IconButton
            onClick={() => setDrawerOpen(false)}
            className="navbar-close-button"
          >
            <CloseIcon />
          </IconButton>
        </div>
        <List className="navbar-drawer-list">
          {!loading && (
            <ListItem>
              <Typography className="navbar-user-text">
                {user
                  ? isAdmin
                    ? `Добро пожаловать, ${user.email}`
                    : `Добро пожаловать, ${user.displayName || user.email}`
                  : "Добро пожаловать, гость"}
              </Typography>
            </ListItem>
          )}
          {!loading && !user && (
            <ListItem button component={Link} to="/register">
              <ListItemText primary="Регистрация" />
            </ListItem>
          )}
          {!loading && user && (
            <ListItem button onClick={handleLogOut}>
              <ListItemText primary="Выйти" />
            </ListItem>
          )}
          {pages.map((page) => (
            <ListItem button key={page.id} component={Link} to={page.link}>
              <ListItemText primary={page.title} />
            </ListItem>
          ))}
        </List>
      </Drawer>
    </div>
  );
};

export default Navbar;
